import { styled } from "styled-components"

const Container = styled.div`
    width: 100vw;
    height: 100vh;
    background:  url("https://www.toddsnyder.com/cdn/shop/files/JulyStyleGuideBB_1600x.png?v=1687795267")center;
`;

const Wrapper  = styled.div``;

const Form = styled.form``;

const Title = styled.h1``;

const Input = styled.input``;

const Agreement  = styled.span``;

const Button = styled.button``;



export const Register = () => {
  return (
    <Container>
        <Wrapper>
            <Title> CREATE AN ACCOUNT </Title>
            <Form>
                <Input placeholder = "name"/>
                <Input placeholder = "last name"/>
                <Input placeholder = "username"/>
                <Input placeholder = "email"/>
                <Input placeholder = "password"/>
                <Input placeholder = "confirm password"/>
                <Agreement>
                    By creating an account, I consent to the processing of my personal data in accordance
                    with the <b> PRIVACY POLICY </b>
                </Agreement>
                <Button>CREATE</Button>
            </Form>
        </Wrapper>
    </Container>
  )
}
